<template>
  <div><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Microsoft JhengHei&#39;">用户隐私条款</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Microsoft JhengHei&#39;">我们十分重视用户隐私</span><span style="font-family:&#39;MS Gothic&#39;">。</span><span style="font-family:&#39;Microsoft JhengHei&#39;">此隐私条款与您所使用的服务息息相关</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">在使用我们的服务前</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">希望您仔细阅读此隐私条款</span><span style="font-family:&#39;MS Gothic&#39;">。</span><span style="font-family:&#39;Microsoft JhengHei&#39;">一旦您选择使用</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">即表示您认可并接受本条款现有内容及其可能随时更新的内容</span><span style="font-family:&#39;MS Gothic&#39;">。</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-left:25.2pt; margin-bottom:0pt; text-indent:-25.2pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">1.</span><span style="font:7pt &#39;Times New Roman&#39;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style="font-family:&#39;Microsoft JhengHei&#39;">信息收集及保存</span><span style="font-family:&#39;Courier New&#39;">：</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（1）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">为了向您提供更好的服务</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们会在您自愿选择服务或提供信息的情况下系统自动存储注册信息</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">如您注册账号时所提供的姓名</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">手机号码</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">电子邮箱</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">账号名称等个人信息</span><span style="font-family:&#39;MS Gothic&#39;">。</span><span style="font-family:&#39;Microsoft JhengHei&#39;">因此请您在注册时及时</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">详尽</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">准确地提供个人资料</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">所有您原始键入的资料将会被作为注册资料</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">请您保证注册信息的真实性及完整性</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">如果因注册信息不真实而引起的问题</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">由您自行承担相应的后果</span><span style="font-family:&#39;MS Gothic&#39;">。</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（2）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们还可能会记录您在使用我们的服务或产品时所提供</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">形成或留存的各项信息</span><span style="font-family:&#39;Courier New&#39;">；</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（3）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">在您使用我们的服务</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">或访问我们的网页</span><span style="font-family:&#39;Courier New&#39;">/APP</span><span style="font-family:&#39;Microsoft JhengHei&#39;">等其它服务内容时</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们自动接收并将记录您的浏览器和计算机上的信息</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">包括但不限于您的</span><span style="font-family:&#39;Courier New&#39;">IP</span><span style="font-family:&#39;Microsoft JhengHei&#39;">地址</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">浏览器的类型</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">使用的语言</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">访问日期和时间</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">软硬件特征信息及您需求的网页记录等数据</span><span style="font-family:&#39;Courier New&#39;">；</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-left:25.2pt; margin-bottom:0pt; text-indent:-25.2pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">2.</span><span style="font:7pt &#39;Times New Roman&#39;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style="font-family:&#39;Microsoft JhengHei&#39;">信息使用</span><span style="font-family:&#39;Courier New&#39;">：</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（1）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们将会竭尽全力建立健全用户信息保护制度</span><span style="font-family:&#39;MS Gothic&#39;">。</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们承诺不会向任何无关第三方提供</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">出售</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">出租</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">分享或交易您的个人信息</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">除非事先得到您的许可或本隐私条款另有明确规定</span><span style="font-family:&#39;MS Gothic&#39;">。</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（2）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们不允许任何第三方以任何手段收集</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">编辑</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">出售或者无偿传播您的个人信息</span><span style="font-family:&#39;MS Gothic&#39;">。</span><span style="font-family:&#39;Microsoft JhengHei&#39;">任何用户如从事上述活动</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">一经发现</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们有权立即终止与该用户的服务协议</span><span style="font-family:&#39;Courier New&#39;">；</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（3）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">在我们提供服务时</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">可能将您的信息用于身份验证</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">客户服务</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">安全防范</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">诈骗监测</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">存档和备份等用途</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">以预防</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">发现</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">调查欺诈</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">危害安全</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">非法或违反与我们的协议</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">政策或规则的行为</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">以保护您</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们的其他用户</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们或我们的关联公司</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">合作伙伴及其他受信任的第三方供应商</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">服务商</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">代理商及社会公众的合法权益</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">确保我们向您提供的产品和服务的安全性</span><span style="font-family:&#39;Courier New&#39;">；</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（4）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们可能会对我们所提供的服务及产品使用情况进行统计</span><span style="font-family:&#39;MS Gothic&#39;">。</span><span style="font-family:&#39;Microsoft JhengHei&#39;">同时</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们可能会与公众分享这些统计信息</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">以展示我们服务及产品的整体使用趋势</span><span style="font-family:&#39;MS Gothic&#39;">。</span><span style="font-family:&#39;Microsoft JhengHei&#39;">这些统计信息不包含您的任何身份识别信息</span><span style="font-family:&#39;MS Gothic&#39;">。</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-left:25.2pt; margin-bottom:0pt; text-indent:-25.2pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">3.</span><span style="font:7pt &#39;Times New Roman&#39;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style="font-family:&#39;Microsoft JhengHei&#39;">信息分享</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Microsoft JhengHei&#39;">在如下情况下</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们可能会披露您的信息</span><span style="font-family:&#39;Courier New&#39;">：</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（1）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">经您事先同意</span><span style="font-family:&#39;Courier New&#39;">；</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（2）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">据法律</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">法规</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">法律程序的要求或法院</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">政府主管部门等的强制性要求</span><span style="font-family:&#39;Courier New&#39;">；</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（3）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">您出现违反中国有关法律</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">法规或者日化最前线协议等相关规则的情况</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">需要向第三方披露</span><span style="font-family:&#39;Courier New&#39;">；</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（4）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">为提供您所要求的产品和服务</span><span style="font-family:&#39;Courier New&#39;">；</span><span style="font-family:&#39;Microsoft JhengHei&#39;">履行</span><span style="font-family:&#39;MS Gothic&#39;">《</span><span style="font-family:&#39;Microsoft JhengHei&#39;">日化最前线协议</span><span style="font-family:&#39;MS Gothic&#39;">》</span><span style="font-family:&#39;Microsoft JhengHei&#39;">或本隐私条款的义务和行使我们的权利</span><span style="font-family:&#39;Courier New&#39;">；</span><span style="font-family:&#39;Microsoft JhengHei&#39;">理解</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">维护和改善我们的服务</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">而和我们的关联公司</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">合作伙伴或第三方服务供应商</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">承包商及代理商等分享您的个人信息</span><span style="font-family:&#39;Courier New&#39;">；</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（5）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">它我们根据法律</span><span style="font-family:&#39;MS Gothic&#39;">、</span><span style="font-family:&#39;Microsoft JhengHei&#39;">法规或者网站政策认为合适的披露</span><span style="font-family:&#39;MS Gothic&#39;">。</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-left:25.2pt; margin-bottom:0pt; text-indent:-25.2pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">4.</span><span style="font:7pt &#39;Times New Roman&#39;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style="font-family:&#39;Microsoft JhengHei&#39;">未成年人信息保护</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（1）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们非常重视对未成年人信息的保护</span><span style="font-family:&#39;MS Gothic&#39;">。</span><span style="font-family:&#39;Microsoft JhengHei&#39;">若您是</span><span style="font-family:&#39;Courier New&#39;">18</span><span style="font-family:&#39;Microsoft JhengHei&#39;">周岁以下的未成年人</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">在使用我们的产品或服务前</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">应事先取得您的家长或法定监护人的同意</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">或在其陪同下进行使用</span><span style="font-family:&#39;MS Gothic&#39;">。</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们根据国家相关法律法规的规定保护未成年人的个人信息</span><span style="font-family:&#39;MS Gothic&#39;">。</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（2）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">对于父母或法定监护人同意而收集未成年人个人信息的情况</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们只会在收到法律允许</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">父母或监护人明确同意或者保护未成年人所必要的情况下使用或公开披露此信息</span><span style="font-family:&#39;MS Gothic&#39;">。</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">（3）</span><span style="font-family:&#39;Microsoft JhengHei&#39;">如果我们发现自己在未事先获得可证实的父母或法定监护人同意的情况下收集乐未成年人的个人信息</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">则会设法尽快删除相关数据</span><span style="font-family:&#39;MS Gothic&#39;">。</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-left:25.2pt; margin-bottom:0pt; text-indent:-25.2pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">5.</span><span style="font:7pt &#39;Times New Roman&#39;">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style="font-family:&#39;Microsoft JhengHei&#39;">修订</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Microsoft JhengHei&#39;">我们可能会随时对本隐私条款进行修订</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">我们将会在网页相关位置予以发布提示</span><span style="font-family:&#39;Courier New&#39;">，</span><span style="font-family:&#39;Microsoft JhengHei&#39;">请您随时关注</span><span style="font-family:&#39;MS Gothic&#39;">。</span></p><p style="margin-top:0pt; margin-bottom:0pt; font-size:10.5pt"><span style="font-family:&#39;Courier New&#39;">&nbsp;</span></p></div>
